import React, { useState } from 'react'
import { Accordion, AccordionSummary, Tab, Typography } from '@mui/material'
import AccordionDetails from '@mui/material/AccordionDetails';
import Box from '@mui/material/Box';
import Tabs from '@mui/material/Tabs';
import Paper from '@mui/material/Paper';

// import LinkTab 
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const HybridGeyser = () => {
    const [value, setValue] =useState(0)

  const handleChange = (event, newValue) =>{
      setValue(newValue)
  };
  return (
    <div>
      <Accordion>
            <AccordionSummary 
            
            expandIcon={<ExpandMoreIcon />}
            aria-controls="panel1a-content"
            id="panel1a-header"
            sx={{bgcolor:'red' , color:'white'}}>
            <Typography>Geyser On</Typography>

            </AccordionSummary>
            <AccordionDetails>
            <Box sx={{border:'1px solid red' ,bgcolor:'background.paper' ,width:"100%" , height:40,
          display: 'flex',
          justifyContent: 'center',
        //   p: 1,
        //   m: 1,
          bgcolor: 'background.paper',
          borderRadius: 1,
        
        }}>
      
      <Paper elevation={3}>
      <Tabs>
      <Tab
      // value="one"
      label="Overview"
      href ="/Tab1"
      />
    <Tab
      // value="two"
      label="Setting"
      href= "/Tab2"
      />
    
    </Tabs>
    </Paper>
    </Box>
    <Box sx={{display: 'flex',
          flexWrap: 'wrap',
          p: 1,
          m: 1,
          bgcolor: 'red',
          maxWidth: 300,
          borderRadius: 1,}}>hello</Box>

            </AccordionDetails>

      </Accordion>
      
    </div>
  )
}

export default HybridGeyser
